export class Utils
{
  public static makeDate(input: string): Date
  {
    input = input.substring(0, input.length - 1); //remove colon
    const date: Date = new Date();
    let d: string[] = input.split("-");
    return new Date(Number(d[2]), Number(d[0]) - 1, 2000 + Number(d[1]));
  }
}
